import React from "react";
import { Row, Col } from "reactstrap";

import products from "../../products";
import Product from "./../../components/Product";

const Home = () => {
  return (
    <>
      <h1 className="my-4">Latest Products</h1>
      <Row>
        {products.map((product) => (
          <Col sm={12} md={6} lg={3}>
            <Product product={product} />
          </Col>
        ))}
      </Row>
    </>
  );
};

export default Home;
